export default {
  name: 'list',
  props: {
    list: Array,
    is_order: {
      type: String,
      default: '否'
    }
  },
  methods: {
    handelToshop(item) {
      if (this.is_order === '是') {
        if (item.ecblacklist === 3) {
          this.$message.error('黑名单门店不可选择')
          return
        }
        if (item.blacklist === 2) {
          this.$message.error('黑名单门店不可选择')
          return
        }
      }
      this.$emit('handelToshop', item)
    }
  }
}
